import "./HotelImages.css";

export const HotelImages = ({ singleHotel }) => {
  console.log(singleHotel);
  const { image, imageArr } = singleHotel;

  return (
    <div className="hotel-image-container flex flex-col md:flex-row gap-small md:gap-4">
      <div className="primary-image-container flex-shrink-0">
        <img className="primary-img w-full h-64 md:w-40 md:h-full object-cover" src={image} alt="hotel" />
      </div>
      <div className="d-flex flex-wrap gap-small">
        {imageArr &&
          imageArr.map((img, index) => (
            <img
              key={index} // Using index as key as image URL might not be unique
              className="hotel-img w-20 h-32 md:w-32 md:h-24 object-cover" // Adjust width for responsiveness
              src={img}
              alt="hotel"
            />
          ))}
      </div>
    </div>
  );
};
